script: |
  super -f text -I q5747.spq | sort > q5747.out

inputs:
  - name: q5747.spq
    data: |
      SELECT DISTINCT ( - col1 ) / + 44 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 31 BETWEEN - col0 + + 73 AND - col0;
  - name: tab0

outputs:
  - name: q5747.out
    data: |
      -1
      0
